package operators;

public class MathFunctions {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		double x;
		x=Math.max(22, 33);
		System.out.println(x);
		x=Math.sqrt(64);
		System.out.println(x);
		x=Math.abs(-55);
		System.out.println(x);
		x=Math.pow(2, 5);
		System.out.println(x);
		x=Math.min(12, -7);
		System.out.println(x);
		x=Math.log(3);
		System.out.println(x);
	

	}

}
